import React, { Component } from 'react'
import { DatePicker} from 'antd';

export default class Find extends Component {
    render() {
        return (
            <div>
                <h3>查询某注射点某天的剩余疫苗数量</h3><br/>
                想查找哪一天：<DatePicker/><br/>
                <h4>输出这天各注射点的剩余疫苗量：</h4><br/>
                注射点1：<br/>
                注射点2：<br/>
                注射点3：<br/>
                注射点4：
                <hr/>
                <h3>查询某天所有注射点的剩余疫苗数量</h3><br/>
                想查找哪一天：<DatePicker/><br/>
            </div>
        )
    }
}
